import Head from 'next/head'
import Container from '../components/Container'

const Index=()=>{
    return (
        <Container>
            <Head>
                <title>Next.js ProJects - Home</title>
            </Head>
                    <h1>Index</h1>
        </Container>  
    )
}

export default Index;
